import React from 'react'
import { useSelector } from 'react-redux'

export default function Detail() {

const details = useSelector((state)=> state.allCountries);

const key = details.id

console.log(details, 'loggg');



  return (
    <div>
        <img src={details.image} alt='Without flag'/>
        <h3>{details.id}</h3>
        <h3>{details.name}</h3>
        <h3>{details.continent}</h3>
        <h3>{details.capital}</h3>
        <h3>{details.subregion}</h3>
        <h3>{details.area}</h3>
        <h3>{details.population}</h3>
        <h3>{details.activities}</h3>
        {key}
    </div>
  )
};
